{
  "translationLines": [
    {
      "lineNumber": 6301,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": "「..............」"
    },
    {
      "lineNumber": 6302,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "「....................」"
    },
    {
      "lineNumber": 6303,
      "originalJapaneseLine": "「…………………………」",
      "translatedEnglishLine": "「........................」"
    },
    {
      "lineNumber": 6304,
      "originalJapaneseLine": "「やー、ネタバラし早いですやんー。",
      "translatedEnglishLine": "「Hey, you're revealing the punchline too soon."
    },
    {
      "lineNumber": 6305,
      "originalJapaneseLine": "　いけずやなー」",
      "translatedEnglishLine": "　That's mean, you know。」"
    },
    {
      "lineNumber": 6306,
      "originalJapaneseLine": "「う、うううう、嘘っぱちか貴様ーーーー！」",
      "translatedEnglishLine": "「N-No way, you’re lying—You bastard！」"
    },
    {
      "lineNumber": 6307,
      "originalJapaneseLine": "「いえ、ワテも流通業だけやなしに、",
      "translatedEnglishLine": "「No, I’m not just in distribution,"
    },
    {
      "lineNumber": 6308,
      "originalJapaneseLine": "　コンテンツビジネスに手ぇつけようと",
      "translatedEnglishLine": "　I’m also trying to get involved in the content business."
    },
    {
      "lineNumber": 6309,
      "originalJapaneseLine": "　思いましてん」",
      "translatedEnglishLine": "」"
    },
    {
      "lineNumber": 6310,
      "originalJapaneseLine": "「今の台本、どないやろ。",
      "translatedEnglishLine": "「What do you think of this script?"
    },
    {
      "lineNumber": 6311,
      "originalJapaneseLine": "　金にならへんかなー」",
      "translatedEnglishLine": "　Think it'll make any money?」"
    },
    {
      "lineNumber": 6312,
      "originalJapaneseLine": "「やかましい、死ね！」",
      "translatedEnglishLine": "「Shut up, die！」"
    },
    {
      "lineNumber": 6313,
      "originalJapaneseLine": "「はわわわー」",
      "translatedEnglishLine": "「Eek—」"
    },
    {
      "lineNumber": 6314,
      "originalJapaneseLine": "「結局お金……なんですね」",
      "translatedEnglishLine": "「In the end, it’s all about the money... huh」"
    },
    {
      "lineNumber": 6315,
      "originalJapaneseLine": "「はあ……ホントの所は聞けずじまいね」",
      "translatedEnglishLine": "「Sigh... I guess I never really got to hear the truth」"
    },
    {
      "lineNumber": 6316,
      "originalJapaneseLine": "「無いのかもなあ、理由なんて……」",
      "translatedEnglishLine": "「Maybe there isn’t even a reason...」"
    },
    {
      "lineNumber": 6317,
      "originalJapaneseLine": "「まあまあ。ついにわたくしの出番ですのね」",
      "translatedEnglishLine": "「Well now, it’s finally my turn, isn’t it」"
    },
    {
      "lineNumber": 6318,
      "originalJapaneseLine": "「ふふふ…………うふふふふ……」",
      "translatedEnglishLine": "「Fufufu... Ufufufufu...」"
    },
    {
      "lineNumber": 6319,
      "originalJapaneseLine": "「……おい。",
      "translatedEnglishLine": "「...Hey."
    },
    {
      "lineNumber": 6320,
      "originalJapaneseLine": "　なんか部屋の隅に、ハニワがいるんだが」",
      "translatedEnglishLine": "　There’s a haniwa (clay figurine) in the corner of the room." 
    },
    {
      "lineNumber": 6321,
      "originalJapaneseLine": "「この間仲間になった、ハニ子さんじゃないですか」",
      "translatedEnglishLine": "「Isn’t that Haniko-san, who joined us the other day？」"
    },
    {
      "lineNumber": 6322,
      "originalJapaneseLine": "「……そうだったか？",
      "translatedEnglishLine": "「...Was that so?"
    },
    {
      "lineNumber": 6323,
      "originalJapaneseLine": "　ハニワの見分けなんてつかんが……」",
      "translatedEnglishLine": "　I can’t really tell haniwa apart..." 
    },
    {
      "lineNumber": 6324,
      "originalJapaneseLine": "「うふふふふ」",
      "translatedEnglishLine": "「Ufufufufu」"
    },
    {
      "lineNumber": 6325,
      "originalJapaneseLine": "「うおっ！？",
      "translatedEnglishLine": "「Whoa!?"
    },
    {
      "lineNumber": 6326,
      "originalJapaneseLine": "　さ、さっきまで逆側にいなかったか！？」",
      "translatedEnglishLine": "　Weren’t you on the other side just a moment ago!？」"
    },
    {
      "lineNumber": 6327,
      "originalJapaneseLine": "「さっきこっちに移動してたぜ」",
      "translatedEnglishLine": "「She just moved over here a moment ago」"
    },
    {
      "lineNumber": 6328,
      "originalJapaneseLine": "「いつだ、さっきって……」",
      "translatedEnglishLine": "「When exactly was ‘a moment ago’...?」"
    },
    {
      "lineNumber": 6329,
      "originalJapaneseLine": "「うふ」",
      "translatedEnglishLine": "「Ufu」"
    },
    {
      "lineNumber": 6330,
      "originalJapaneseLine": "「うおぁっ！？」",
      "translatedEnglishLine": "「Uwah!？」"
    },
    {
      "lineNumber": 6331,
      "originalJapaneseLine": "いつの間にか、",
      "translatedEnglishLine": "Before anyone noticed,"
    },
    {
      "lineNumber": 6332,
      "originalJapaneseLine": "ハニ子はランスの目の前に立っていた。",
      "translatedEnglishLine": "Haniko was standing right in front of Rance."
    },
    {
      "lineNumber": 6333,
      "originalJapaneseLine": "「……なんの用だ、おい」",
      "translatedEnglishLine": "「...What do you want, hey」"
    },
    {
      "lineNumber": 6334,
      "originalJapaneseLine": "「見極めているの……",
      "translatedEnglishLine": "「I’m assessing you..."
    },
    {
      "lineNumber": 6335,
      "originalJapaneseLine": "　あなたが、王様の災いにならないか……」",
      "translatedEnglishLine": "　to see if you will become a calamity for the king...」"
    },
    {
      "lineNumber": 6336,
      "originalJapaneseLine": "「見て分かるのかそんなもん。",
      "translatedEnglishLine": "「Can you really tell that just by looking?"
    },
    {
      "lineNumber": 6337,
      "originalJapaneseLine": "　そもそも、目や脳ミソがあるのか、お前ら……」",
      "translatedEnglishLine": "　Do you guys even have eyes or brains in the first place...」"
    },
    {
      "lineNumber": 6338,
      "originalJapaneseLine": "「大きな口……目つきの悪い顔立ち……",
      "translatedEnglishLine": "「Big mouth... a mean look... "
    },
    {
      "lineNumber": 6339,
      "originalJapaneseLine": "　品のない座り方……」",
      "translatedEnglishLine": "　a low-class way of sitting...」"
    },
    {
      "lineNumber": 6340,
      "originalJapaneseLine": "「………………ぽっ」",
      "translatedEnglishLine": "「........... *blush*」"
    },
    {
      "lineNumber": 6341,
      "originalJapaneseLine": "「あ？」",
      "translatedEnglishLine": "「Huh？」"
    },
    {
      "lineNumber": 6342,
      "originalJapaneseLine": "「ああ、いけないわ……",
      "translatedEnglishLine": "「Ah, that’s no good..."
    },
    {
      "lineNumber": 6343,
      "originalJapaneseLine": "　ハニ子には王様がいるのに……」",
      "translatedEnglishLine": "　Haniko has a king, after all...」"
    },
    {
      "lineNumber": 6344,
      "originalJapaneseLine": "「なんか知らんが、褒められてはいないな？",
      "translatedEnglishLine": "「I don’t know why, but I’m not being praised, am I?"
    },
    {
      "lineNumber": 6345,
      "originalJapaneseLine": "　割るか…………」",
      "translatedEnglishLine": "　Should I break you...？」"
    },
    {
      "lineNumber": 6346,
      "originalJapaneseLine": "「まぁ。レディには優しく接して欲しいわ」",
      "translatedEnglishLine": "「Well, I want you to treat the lady kindly」"
    },
    {
      "lineNumber": 6347,
      "originalJapaneseLine": "「ランス様、乱暴は……」",
      "translatedEnglishLine": "「Lord Rance, roughness is—」"
    },
    {
      "lineNumber": 6348,
      "originalJapaneseLine": "「ちっ、まあいい。どうでもいい。",
      "translatedEnglishLine": "「Tch, whatever. Doesn’t matter."
    },
    {
      "lineNumber": 6349,
      "originalJapaneseLine": "　視界に入ってくるな。しっしっ」",
      "translatedEnglishLine": "　Don’t get in my sight. Shoo, shoo」"
    },
    {
      "lineNumber": 6350,
      "originalJapaneseLine": "「ふふふ。はーい」",
      "translatedEnglishLine": "「Fufufu. Yes yes」"
    },
    {
      "lineNumber": 6351,
      "originalJapaneseLine": "ハニ子はランスの視界から消えた。",
      "translatedEnglishLine": "Haniko disappeared from Rance’s view."
    },
    {
      "lineNumber": 6352,
      "originalJapaneseLine": "「大人しく消えたか……」",
      "translatedEnglishLine": "「She disappeared quietly, huh...」"
    },
    {
      "lineNumber": 6353,
      "originalJapaneseLine": "「じーーーーっ……」",
      "translatedEnglishLine": "「*stareeee*」"
    },
    {
      "lineNumber": 6354,
      "originalJapaneseLine": "「…………んん？」",
      "translatedEnglishLine": "「...Hmm？」"
    },
    {
      "lineNumber": 6355,
      "originalJapaneseLine": "「じぃぃーーーーーっ……」",
      "translatedEnglishLine": "「*stare*」"
    },
    {
      "lineNumber": 6356,
      "originalJapaneseLine": "「お、っ…………！」",
      "translatedEnglishLine": "「Oh, uh...！」"
    },
    {
      "lineNumber": 6357,
      "originalJapaneseLine": "「落ち着かんッ…………！」",
      "translatedEnglishLine": "「I can’t calm down...！」"
    },
    {
      "lineNumber": 6358,
      "originalJapaneseLine": "「おいこらハニワ！　いつまで見てる！」",
      "translatedEnglishLine": "「Hey you, haniwa! How long are you going to stare!?」"
    },
    {
      "lineNumber": 6359,
      "originalJapaneseLine": "「…………はっ。寝てたわ……いけないいけない。",
      "translatedEnglishLine": "「...Oh. I was asleep... No, no."
    },
    {
      "lineNumber": 6360,
      "originalJapaneseLine": "　お肌のためには質の良い睡眠よね」",
      "translatedEnglishLine": "　Good quality sleep is important for the skin, you know」"
    }
  ]
}

